import React from "react";
import Home from "../components/homes/Home";
import Body from "../components/Body";
import Quest from "../components/homes/Quest";
import Feat from "./Feat";
import Ads from "./Ads";

const HomePages = () => {
  return (
    <>
      <Home />
      <Body />
      <Quest />
      <Feat />
      <Ads />
    </>
  );
};

export default HomePages;
